import React from "react";
import "./MensFashionPage.css";

const MensFashionPage = () => {
  const mensItems = [
    {
      id: 1,
      title: "Men's T-Shirt",
      description: "Comfortable cotton t-shirt.",
      price: "₹249",
      image:
        "https://rukminim2.flixcart.com/image/612/612/xif0q/t-shirt/l/v/e/l-ts36-vebnor-original-imah4zb9rswzzbvc.jpeg?q=70",
    },
    {
      id: 2,
      title: "Men's Jacket",
      description: "Stylish winter jacket.",
      price: "$40",
      image:
        "https://via.placeholder.com/300x300?text=Men's+Jacket",
    },
    {
      id: 3,
      title: "Men's Jeans",
      description: "Slim fit jeans.",
      price: "$25",
      image:
        "https://via.placeholder.com/300x300?text=Men's+Jeans",
    },
    {
      id: 4,
      title: "Men's Shoes",
      description: "Comfortable running shoes.",
      price: "$50",
      image:
        "https://via.placeholder.com/300x300?text=Men's+Shoes",
    },
    {
      id: 5,
      title: "Men's Watch",
      description: "Classic leather watch.",
      price: "$80",
      image:
        "https://via.placeholder.com/300x300?text=Men's+Watch",
    },
    {
      id: 6,
      title: "Men's Cap",
      description: "Trendy summer cap.",
      price: "$10",
      image:
        "https://via.placeholder.com/300x300?text=Men's+Cap",
    },
  ];

  return (
    <div className="mens-fashion-page">
      <h1>Men's Fashion</h1>
      <div className="mens-grid">
        {mensItems.map((item) => (
          <div className="mens-card" key={item.id}>
            <img src={item.image} alt={item.title} />
            <div className="mens-details">
              <h2>{item.title}</h2>
              <p>{item.description}</p>
              <span>{item.price}</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MensFashionPage;
